import 'bootstrap/dist/css/bootstrap.css';
//import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import { useState } from 'react';
import Axios from 'axios';
//import de páginas
import Registro from './Registro';
import Dashboard from './Dashboard';
import Explore from './Explore';
import InicioSesion from './is';
import Perfil from './perfil';
import Publicacion from './publicacion';
import Editperfil from './editPerfil';
import Stats from './stats';
import Editpost from './editpost';
import CreatePost from './createPost';

import Usuarios from './Usuarios';
import CargarImagen from './CargarImage';

function App() {

  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<InicioSesion />}></Route>
        <Route path='/registro' element={<Registro />}></Route> {/* Cambiar ruta a /registro */}
        <Route path='/tablero' element={<Dashboard />}></Route> {/* Cambiar ruta a /tablero */}
        <Route path='/explorar' element={<Explore />}></Route> {/* Cambiar ruta a /explorar */}
        <Route path='/perfil/:userId' element={<Perfil />}></Route>
        <Route path='/publicacion/:id_post' element={<Publicacion />}></Route>
        <Route path='/editar-perfil' element={<Editperfil />}></Route> {/* Cambiar ruta a /editar-perfil */}
        <Route path='/estadisticas' element={<Stats />}></Route> {/* Cambiar ruta a /estadisticas */}
        <Route path='/estadisticas/publicaciones-likes' element={<Stats option="publicacionesLikes" />} />
        <Route path='/estadisticas/interacciones-semanales' element={<Stats option="interaccionesSemanales" />} />
        <Route path='/estadisticas/seguidores-mensuales' element={<Stats option="seguidoresMensuales" />} />
        <Route path='/editar-publicacion/:postId' element={<Editpost />}></Route> {/* Cambiar ruta a /editar-publicacion */}
        <Route path='/crear-publicacion' element={<CreatePost />}></Route> {/* Cambiar ruta a /crear-publicacion */}
        <Route path='/usuarios' element={<Usuarios />}></Route>
        <Route path='/cargar-imagen' element={<CargarImagen />}></Route> {/* Cambiar ruta a /cargar-imagen */}
      </Routes>
    </BrowserRouter>
  );
}



export default App;
